import React from "react";
import Header from "../header/Header";
import "./home.css";

export default function Home() {
  return (
    <div
      className="Home"
      style={{
        backgroundImage:
          "url(" + "https://tsks.app/img/signin_balls.png" + ")",
      }}
    >
      <Header />

      <div className="content">
      <h1 className="title">Todo App</h1>
      <p className="desc">
        Keep track of the daily tasks in life and get that satisfaction upon
        copletion.
      </p>
      <div className="home__buttons">
        <button className="home__button button btn--bg-pink btn--bb-pink">get started</button>
        <button className="home__button button btn--bg-gray btn--bb-gray">learn more</button>
      </div>
      </div>
    </div>
  );
}
